import React from "react";
import Home from "./Home";
import { BrowserRouter, Route, NavLink } from "react-router-dom";

export default function App() {
  return (
    <>
      <BrowserRouter>
        <NavLink to="/">Home</NavLink>
        <Route path="/" component={Home} />
      </BrowserRouter>
    </>
  );
}
